import React, {useEffect} from 'react';
import axios from 'axios';

const chatRoom = () => {


  useEffect(() => {
    axios.post('http://localhost:5000/chatRoom/searchRoom')
    .then((req, res) => {
      console.log(req);
    })
    .catch(err => {
      console.log(err);
    })
  })

  return(
    <div>Hi</div>
  )
}

export default chatRoom;
